// JavaScript Document
$(document).ready(function() {

	
    /*----Touch-----*/
    document.addEventListener("touchstart", function() {}, false);

    /* --- IF MOBILE --*/
    if (/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent)) {
        $("body").addClass("device-mobile");

        $(function() {
            $(".collapse-panel-md-01").swipe({
                swipeLeft: function() {
                    $(this).addClass("close-p").removeClass("active-p");
                }
            });
        });

        $(function() {
            $(".collapse-panel-sm-01").swipe({
                swipeLeft: function() {
                    $(this).addClass("close-p").removeClass("active-p");
                }
            });
        });

    } else {

        /* --- SUBMENU ---*/
        $(".dropdown").hover(
            function() {
                $('.dropdown-menu', this).not('.in .dropdown-menu').stop(true, true).slideDown(1);
                $(this).toggleClass('show');
            },
            function() {
                $('.dropdown-menu', this).not('.in .dropdown-menu').stop(true, true).slideUp(1);
                $(this).toggleClass('show');
            }
        );

    }

    /* --- RESIZE ON READY --- */
    $(window).trigger('resize');

    /* GRID a LIST view */
    $(".btn-view").click(function() {
        if ($(this).hasClass('unselect')) {
            $(".btn-view").removeClass('active').removeClass("select").addClass("unselect");
            $(this).addClass('active').addClass('select').removeClass('unselect');
        }
    });
    $(".btn-view-grid-small").click(function() {
        $(".contg-list-items-01").find(".cont-item-01").removeClass("col-md-6 col-xl-6");
    });
    $(".btn-view-grid-big").click(function() {
        $(".contg-list-items-01").find(".cont-item-01").addClass("col-md-6 col-xl-6");
    });

    /* --- BTN PANELS --- */
    $(".btn-menu-r").click(function() {
        if ($("." + $(this).attr("data-id")).hasClass('close-p')) {
            $("." + $(this).attr("data-id")).addClass('active-p').removeClass("close-p");
        } else {
            $("." + $(this).attr("data-id")).removeClass('active-p').addClass("close-p");
        }
    });

    $(".btn-show-ele").click(function() {
        if ($("." + $(this).attr("data-id")).hasClass('hidde-p')) {
            $("." + $(this).attr("data-id")).addClass('show-p').removeClass("hidde-p");
        } else {
            $("." + $(this).attr("data-id")).removeClass('show-p').addClass("hidde-p");
        }

        $(".cont-h-search-01.show-p").one("webkitTransitionEnd otransitionend oTransitionEnd msTransitionEnd transitionend",
            function(event) {
                $(".cont-h-search-01 input").trigger('focus');
            });
    });

    /* --- BTN EDIT INPUT --- */
    $(".btn-edit-01").click(function() {
        $('.edit-01').attr('readonly', false).attr('disabled', false);
    });

    $(".btn-edit-02").click(function() {
        $('.edit-02').attr('readonly', false).attr('disabled', false);
    });

    /* --- INPUT CHANGE --- */
    $('input, select').on('keyup change', function() {
        $("form button:not([type=button])").removeAttr("disabled");
    });

    /* --- CLICK AND TOUCH - OUT --- */
	$(".btn-show-ele, .cont-h-search-01").on('click touchstart', function(e) {
        e.stopPropagation();
    });

    $(document).on('click touchstart', function() {
        $(".cont-h-search-01").removeClass('show-p').addClass("hidde-p");
    });

    /* CARROUSEL */
    $('.owl-01').owlCarousel({
        center: true,
        loop: true,
        nav: true,
        dots: false,
        navText: ['<span class="fa fa-chevron-left f-size-60"></span>', '<span class="fa fa-chevron-right f-size-60"></span>'],
        responsive: {
            0: {
                items: 1,
            },

            560: {
                items: 2,
            },
            769: {
                items: 3,
            }
        }
    });

    $('.owl-02').owlCarousel({
        loop: true,
        nav: false,
        dots: true,
        responsive: {
            0: {
                items: 3,
            },
            767: {
                items: 4,
            }
        }
    });
	
	
	if($('.carrousel-secs-01').find('.box-sec-01').length < 3) {
		$(".box-sec-01").removeClass("width-100vw").addClass("width-50vw");
	}
	
	if($('.carrousel-secs-01').find('.box-sec-01').length < 2) {
		$(".box-sec-01").removeClass("width-50vw").addClass("width-100vw");
	}	
	
	if($('.carrousel-secs-01').find('.box-sec-01').length > 2) {
		
		$('.owl-03').owlCarousel({		
        nav: true,
        dots: false,
        navText: ['<span class="fa fa-chevron-left f-size-40"></span>', '<span class="fa fa-chevron-right f-size-40"></span>'],
        responsive: {
            0: {
                items: 1,
            },

            560: {
                items: 2,
            },
            769: {
                items: 3,
            }
        }
    });	
		
		//$(".owl-03 .box-sec-01").addClass("width-100vw");
	}
		
	/*if($('.carrousel-secs-01').find('.owl-item').length < 3) {
		$(".owl-03 .box-sec-01").addClass("width-50vw");
	}*/


    /* --- LIGHTBOX --- */
    $(document).on('click', '[data-toggle="lightbox"]', function(event) {
        event.preventDefault();
        $(this).ekkoLightbox();
    });

    /* ---- FIXTO --- */
    $('.sticky').fixTo('.sticky-holder', {
        useNativeSticky: false,
    });

    $('.sticky-01').fixTo('.sticky-holder', {
        mind: 'header',
        top: -2,
    });

    /* --- MISMO ALTO --- */
    equalHeight($(".same-height-a"));
    equalHeight($(".same-height-b"));
    equalHeight($(".same-height-c"));

    /* --- SCROLL DOWN --- */
    $(window).scroll(function() {
        if ($(document).scrollTop() > 100) {
            $('header').addClass('scrolldown');
            $(".minus-h-01").height($(window).height() - $("header").height());
            setTimeout(function() {
                $('.sticky-01').fixTo('refresh');
                myScroll.refresh();
            }, 180);
        } else {
            $('header').removeClass('scrolldown');
            $('.sticky-01').fixTo('refresh');
            myScroll.refresh();
            $(".minus-h-01").height($(window).height() - $("header").height());
        }
    });

    /* --- CLICK SECOND LINK DROPDOWN --- */
    $('a[data-toggle="dropdown"]:not([href=""])').off('click.namespace').on('click.namespace',
        function(e) {
            if ($(this).parent().is('.show, .open'))
                window.open($(this).attr(
                    'href'), $(this).attr('target') || '_self');
        });

    /* --- CENTER VERTICALLY MODAL ---*/
    (function($) {
        "use strict";

        function centerModal() {
            $(this).css('display', 'block');
            var $dialog = $(this).find(".modal-dialog"),
                offset = ($(window).height() - $dialog.height()) / 2,
                bottomMargin = parseInt($dialog.css('marginBottom'), 10);

            $dialog.css("margin-top", offset);
        }

        $(document).on('show.bs.modal', '.modal', centerModal);
        $(window).on("resize", function() {
            $('.modal:visible').each(centerModal);
        });
    }(jQuery));

    /* --- MODAL OPEN MODAL ---*/
    $(document).on('hidden.bs.modal', function(event) {
        if ($('.modal:visible').length) {
            $('body').addClass('modal-open');
        }
    });

    /* --- WIDTH AUTO SELECT --- */
    var selects = $('select.w-auto');
    selects.each(function(index, select) {
        $(select).change(function() {
            $(select).next().children().first().html($(select).children('option:selected').text());
            $(select).width($(select).next().width());
        });
    });

    /* --- RESTAR PIXELES --- */
    $(window).resize(function(e) {
        $(".cont-slider").height($(window).height() - $(".same-height-a").height());
        $(".minus-h-01").height($(window).height() - $("header").height());
        $("main").css("min-height", $(window).height() - $("header").height());
    }).resize();

    /* --- CENTER V --- */
    $('.center-v').flexVerticalCenter();

    /* --- CREAD DIVS --- */
	$(function() {
        for (i = 0; i < 4; i++) {
            $('<div class="crois">').appendTo('.cont-banner-01, .cont-item-01, .deco-crois');
        }
    });

    /* --- REFRESH --- */
    setTimeout(function() {
        $('.sticky-01').fixTo('refresh');
        myScroll.refresh();
    }, 500);

});

/* --- iSCROLL ---*/
var myScroll;

function loaded() {
    myScroll = new IScroll('#wrapper', {
        scrollbars: true,
        mouseWheel: true,
        interactiveScrollbars: true,
        shrinkScrollbars: 'scale',
        fadeScrollbars: false,
    });
}

/* --- FOOTER RESPONSIVE --- */
$(window).resize(function(e) {
    var width = $(window).width();
    if (width <= 767) {
        $('footer .collapse-panel-sm-01').each(function() {
            $(this).appendTo("body");
        });
    }
});



